import React, { useState } from "react";

const Test = () => {
  const [element1, setElement1] = useState("Hello World");
  const handleChange = ({ target }) => {
    setElement1(target.value);
    console.log(target.value);
  };
  return (
    <React.Fragment>
      <h1>{element1}</h1>
      <input
        type="text"
        placeholder="Enter Name"
        onChange={handleChange}
        name="testName"
      />
    </React.Fragment>
  );
};

export default Test;
